import './App.css';
import DiaryEditor from './DiaryEditor';
import DiaryList from './DiaryList';

const dummyList = [
  {
    id:1,
    author:"민송경",
    content:"ㅎㅇ",
    emotion:5,
    create_date: new Date().getTime() // milliseconds 숫자로 변환해서 저장(string화 위해)
  },
  {
    id:2,
    author:"민송경2",
    content:"ㅎㅇ2",
    emotion:3,
    create_date: new Date().getTime() // milliseconds 숫자로 변환해서 저장(string화 위해)
  },
  {
    id:3,
    author:"민송경3",
    content:"ㅎㅇ3",
    emotion:2,
    create_date: new Date().getTime() // milliseconds 숫자로 변환해서 저장(string화 위해)
  }
]

function App() {
  return (
    <div className="App">
    <DiaryEditor/>
    <DiaryList/>
    </div>
  );
}

export default App;
